import React, { useState } from 'react'
import skill from "./dataSkill"

const Myskills=()=> {
  // const[skills,setskills]=useState(0);
  return (
    <>
    <section className='skill-section'>
      <div className='portfolio-container'>
        <p className='section-title'>My Skills</p>
        <h2 className='skill-section-heading'>My Expertise</h2>
      </div>
      <div className='skill-section-container'>
      {skill.map((curElem) => {
        const{id,image,title,description}=curElem;
        return(
          <div key={skill.id} className="skill-section-card">
            <div className="skill-section-img">
              <img src={skill.src} alt="Frontend Web Developement" />
            </div>
            <div className="skill-section-card-content">
              <h3 className="skill-section-title">hh{title}</h3>
              <p className="skill-section-description">{description}</p>
            </div>
          </div>
        )
      })}
      </div>
    </section>
    </>
  )
}

export default Myskills
